import Immutable from 'immutable';
import {HISTORY_INIT} from '../actions/history-actions';

export default function historyItems(state = Immutable.List(), action) {
    switch (action.type) {
        case HISTORY_INIT:
            return state.clear().merge(action.payload);
        default:
            return state;
    }
}
